import React from 'react';

const Projects = () => {
    return (
        <div id='projects' className='container'>
            <div className='body-padding'>
                <div className='text-center section-title'>
                    <h2>TMA Magazine</h2>
                </div>
                <div className='col-md-12 body-padding'>
                    <h4>At long last we're going to have our vary own magazine, filled with success stories, interviews, life lessons and some note worthy information about the academy.</h4>
                    <div>
                        <img className='img-responsive' src={'img/mag.jpg'} />
                    </div>
                </div>  
            </div>
            <br />
        </div>
    )
}

export default Projects;
